// Navbar.js

import React from 'react';

const Navbar = () => {
  return (
    <div className="flex justify-between items-center p-4 bg-accent text-dark">
      <div className="text-lg font-bold">D.</div>
      <div className="flex font=">
        <div className="mx-2">HOME</div>
        <div className="mx-2">SKILLS</div>
        <div className="mx-2">WORKS</div>
        <div className="mx-2">CONTACT ME</div>
      </div>
    </div>
  );
};

export default Navbar;
